import styled from 'styled-components';

export const Div = styled.div`
`

export const Button = styled.button`
  height: 64px;
  width: 64px;
  padding: 8px 16px;
  color: #2D2C2E;
  background-color: transparent;
  transition: opacity  300ms;

  &:hover {
    opacity: 0.2;
    backdrop-filter: blur(20px);
  }
`
